import classNames from "classnames";
import { useState } from "react";
import { PACKAGES } from "../../constants/Fixtires";
import { InputRadioPeriod } from "../InputRadioPeriod/InputRadioPeriod";
import { PackageOption } from "../PackageOption/PackageOptions";
import styles from "./styles.module.css";

export const EditPackageForm = ({ togglePopup }) => {
  const [form, setForm] = useState({
    pack: PACKAGES.start,
    packagePeriod: undefined,
    officePeriod: undefined,
    office: false,
    packageDate: undefined,
    qr: false,
    frontOffice: undefined,
    tarification: false,
    mobile: undefined,
    officeCount: undefined,
  });

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <>
        <div className={styles.container}>
          <div className={styles.date_container}>
            <input
              type="date"
              id="dateStart"
              value={form.packageDate}
              onChange={(e) =>
                setForm({ ...form, packageDate: e.target.value })
              }
              className={styles.date}></input>
            <label
              htmlFor="dateStart"
              className={styles.label}>
              Дата начала
            </label>
          </div>
          <div className={styles.date_container}>
            <input
              type="number"
              id="office"
              value={form.frontOffice}
              onChange={(e) =>
                setForm({ ...form, frontOffice: e.target.value })
              }
              className={styles.count}></input>
            <label
              htmlFor="office"
              className={classNames(styles.count_label, styles.label)}>
              Количество Front-office
            </label>
          </div>
        </div>
        <div className={styles.period_container}>
          <h3 className={styles.period_title}>Период</h3>
          <InputRadioPeriod
            label={"1 месяц"}
            active={form.packagePeriod === 1}
            setValue={() => setForm({ ...form, packagePeriod: 1 })}
          />
          <InputRadioPeriod
            label={"3 месяца"}
            active={form.packagePeriod === 3}
            setValue={() => setForm({ ...form, packagePeriod: 3 })}
          />
          <InputRadioPeriod
            label={"1год"}
            active={form.packagePeriod === 12}
            setValue={() => setForm({ ...form, packagePeriod: 12 })}
          />
          <InputRadioPeriod
            label={"2 года"}
            active={form.packagePeriod === 24}
            setValue={() => setForm({ ...form, packagePeriod: 24 })}
          />
          <InputRadioPeriod
            label={"3 года"}
            active={form.packagePeriod === 36}
            setValue={() => setForm({ ...form, packagePeriod: 36 })}
          />
        </div>
        <PackageOption
          label={"Тарификация"}
          checked={form.tarification}
          setValue={() =>
            setForm({ ...form, tarification: !form.tarification })
          }
        />
        <PackageOption
          label={"QR Меню"}
          checked={form.qr}
          setValue={() =>
            setForm({ ...form, qr: !form.qr })
          }
        />
        <PackageOption
          label={"Мобильный официант"}
          checked={form.office}
          setValue={() =>
            setForm({ ...form, office: !form.office })
          }
        />
        {form.office && (
          <>
            <div className={styles.container}>
              <div className={styles.date_container}>
                <input
                  type="date"
                  id="dateStart"
                  className={styles.date}
                  value={form.mobile}
                  onChange={(e) =>
                    setForm({ ...form, mobile: e.target.value })
                  }></input>
                <label
                  htmlFor="dateStart"
                  className={styles.label}>
                  Дата начала
                </label>
              </div>
              <div className={styles.date_container}>
                <input
                  type="number"
                  id="office"
                  className={styles.count}
                  value={form.officeCount}
                  onChange={(e) =>
                    setForm({
                      ...form,
                      officeCount: e.target.value >= 0 ? e.target.value : 0,
                    })
                  }></input>
                <label
                  htmlFor="office"
                  className={classNames(styles.count_label, styles.label)}>
                  Количество
                </label>
              </div>
            </div>
            <div className={styles.period_container}>
              <InputRadioPeriod
                label={"1 месяц"}
                active={form.officePeriod === 1}
                setValue={() => setForm({ ...form, officePeriod: 1 })}
              />
              <InputRadioPeriod
                label={"3 месяца"}
                active={form.officePeriod === 3}
                setValue={() => setForm({ ...form, officePeriod: 3 })}
              />
              <InputRadioPeriod
                label={"1год"}
                active={form.officePeriod === 12}
                setValue={() => setForm({ ...form, officePeriod: 12 })}
              />
              <InputRadioPeriod
                label={"2 года"}
                active={form.officePeriod === 24}
                setValue={() => setForm({ ...form, officePeriod: 24 })}
              />
              <InputRadioPeriod
                label={"3 года"}
                active={form.officePeriod === 36}
                setValue={() => setForm({ ...form, officePeriod: 36 })}
              />
            </div>
          </>
        )}

        <div
          className={classNames(styles.amount)}>
          120,000
          <button
            type="submit"
            onClick={(e) => handleSubmit(e)}
            className={styles.submit}></button>
        </div>
    </>
  );
};
